import React from 'react'

export default function TodolistDelete(props) {


  return (
    <>
     <li>
      {props.text}
      <button className="btn btn-danger shadow" onClick={() => {
        props.onSelect(props.id);
      }}><i className="fa fa-trash text-white" aria-hidden="true"></i></button>
      </li>
     
    </>
  )
}
